1. Purchase sustainable-sourced seafood. Many turtles die every year due to bycatch in fishing nets. Pledge to buy seafood that's certified as being sustainable and urge stores and restaurants to carry certified fish.

2. Be discerning when traveling. Think twice and ask at least a few questions before buying that tortoiseshell souvenir, coral jewelry or snakeskin belt.

3. Support sea turtle ecotourism. Book a sustainable tour to see turtles, particularly when it benefits local communities.
